import React from 'react'
import Header from '../components/Header';
import Footer from '../components/Footer'
import '../components/css/Home.css';

export default function Rush() {
    return (
        <div>
            <Header />
            <div className="rush">
                <h1>R<span>us</span>h</h1>
                <h2 class="fb-group-link">Join our <strong><a href='https://www.facebook.com/groups/838024823748330/'>Fall 2021 Rush Group on Facebook</a></strong>
                </h2>
            </div>
            <Footer />            
        </div>
    )
}
